import React from 'react';

const NextVideo = (props) => {
    return (
        <>
            <p className="sub-section__heading">NEXT VIDEO</p>
            <div className="sub-section__video-container">
                <div className="sub-section__next-video">
                <img src="/src/assets/images/video-list-1.jpg" className="sub-section__next-video-thumbnail"/>
                <div className="sub-section__next-video-content">
                    <p className="sub-section__video-title">{props.title}</p>
                    <p className="sub-section__video-author">{props.author}</p>
                </div>
                </div>
            </div>
        </>
    );
}

export default NextVideo;
